import styled from "styled-components";
import { COLORS } from "../../constants";

const Wrapper = styled.div`
    background-color: ${COLORS.neutral.blueCard};
    padding: 16px;
    border-radius: 8px;
`;


function Card() {
    return (
        <Wrapper>
            <img src="images/equilibrium.jpg" alt="equilibrium" />
        </Wrapper>
    )
};

export default Card;
